                    "text": "1 рѕљріЊрЇдрїИрїІ рІѕрІГрѕЮ рѕхрїдрЅ│ рѕЏрѕѕрЅх ріљрІЇрЇб\n2 рѕ«рЅцрѕЇрЇдріЦріљрѕє рІѕріЋрІх рѕЇрїЁ рѕЏрѕѕрЅх ріљрІЇрЇб\n3 ріцрѕГрѕЮрІФрѕхрЇдріЦрїЇрІџріарЅЦрѕћрѕГ ріерЇЇ рІФрІ░рѕГрїІрѕЇ рѕЏрѕѕрЅх ріљрІЇрЇб\n4 рѕ«рЅЦрІЊрѕЮрЇдрѕЋрІЮрЅЦ рІГрЅЦрІЏ рѕЏрѕѕрЅх ріљрІЇрЇб\n5 рѕЏрѕФріЊрЅ│рЇдрїїрЅ│ рѕєрІГ ріЊ рѕЏрѕѕрЅх ріљрІЇрЇб\n6 рЅцрЅ┤рѕЇрЇдрІеріЦрїЇрІџріарЅЦрѕћрѕГ рЅцрЅх рѕЏрѕѕрЅх ріљрІЇрЇб\n7 рЅёрѕГрѕјрѕхрЇдрІерЅ░рѕўрѕерїа рѕЮрѕГрїЦ рѕЏрѕѕрЅх ріљрІЇрЇб\n8 ріЦрѕхрїбрЇІріќрѕхрЇдріаріГрѕірѕЇ рѕЏрѕѕрЅх ріљрІЇрЇб\n9 рѕ│рІЇрѕЇ/рѕ│рідрѕЇрЇдріеріЦрїЇрІџріарЅЦрѕћрѕГ рІерЅ░рѕѕрѕўріљ рѕЏрѕѕрЅх ріљрІЇрЇб\n10 рѕ┤рІ┤рЅЁрІФрѕхрЇдрІеріЦрїЇрІџріарЅЦрѕћрѕГ рїйрІхрЅЁ рѕЏрѕѕрЅх ріљрІЇрЇб\n11 рЇірЅЁрїдрѕГрЇдріђрІўріћріЋ ріарѕФрЅђрѕЇріЮ рѕЏрѕѕрЅх ріљрІЇрЇб\n12 ріЋрЇЇрЅ│рѕїрѕЮрЇдрЅ│рїІрІГ рІерѕџрЅ│рїѕрѕЇ рѕЏрѕѕрЅх ріљрІЇрЇб\n13 рІ«рѕГрІ│ріќрѕхрЇдрІѕрѕФрїЁ рѕЏрѕѕрЅх ріљрІЇрЇб\n14 рІ«ріарѕхрЇдріЦрїЇрІџріарЅЦрѕћрѕГ рѕ░рїЦрЅирѕЇ рѕЏрѕѕрЅх ріљрІЇрЇб\n15 рїѕріљрЅхрЇдрІеріарЅхріГрѕЇрЅх рѕхрЇЇрѕФ рѕЏрѕѕрЅх ріљрІЇрЇб\n16 рЇірѕЇрІхрѕЇрЇЇрІФрЇдрІерІѕріЋрІхрѕЏрѕЏрЅй рЇЇрЅЁрѕГ рѕЏрѕѕрЅх ріљрІЇрЇб\n17 рІ▓ріЊрЇдрЇѕрѕерІ░ рѕЏрѕѕрЅх ріљрІЇрЇб\n18 рѕЏріЉрѕёрЇдріЦрѕерЇЇрЅх рѕЏрѕѕрЅх ріљрІЇрЇб\n19 рѕўрѕЇрѕЋрЅЁрЇдріерЅЦрѕерЅх рІерЅ░рѕарѕФ рІерѕўрѕГріерЅЦ рѕЏрЅєрѕџрІФ\n20 рѕФрѕЏрЇдріерЇЇрЅ│ рѕЏрѕѕрЅх ріљрІЇрЇб\n21рЅ┤рІјрІхрѕ«рѕхрЇдрІеріЦрїЇрІџріарЅЦрѕћрѕГ рѕхрїдрЅ│ рѕЏрѕѕрЅх ріљрІЇрЇб\n22 рЇірѕІрЅ│рІјрѕхрЇдрІеріарѕЮрѕІріГ рІѕрІ│рїЁ рѕЏрѕѕрЅх ріљрІЇрЇб\n23 рѕЋрѕГрІФрЅєрѕхрЇдріЁрѕЕрІГ рѕЮрѕГрїЦ рѕЏрѕѕрЅх ріљрІЇрЇб\n24 рЇірѕЇрїХрѕхрЇдрІѕріЋрІхрѕЮ рІѕрІ│рїЁ рѕЏрѕѕрЅх ріљрІЇрЇб\n25 рЅХрѕЏрѕхрЇдрЇђрѕљрІГ рѕЏрѕѕрЅх ріљрІЇрЇб\n26 рЅ│рІ┤рІјрѕхрЇдріЦрѕИрЅ▒ рѕЏрѕѕрЅх ріљрІЇрЇб(рїЇрЅЦрѕФрІі рЅхрѕГрїЊрѕюрІЇ)\n27 рѕЏрЅхрІФрѕхрЇдрЇђрѕљрІГ рІѕрІГрѕЮ рѕЮрЅхріГ рѕЏрѕѕрЅх ріљрІЇрЇб\n28 рЅђрѕїрѕЮріЋрїдрѕхрЇдрїЇріЋрЅЦ рѕЏрѕѕрЅх ріљрІЇрЇб\n29 ріарЅцрѕЇрЇдрЅарїЇ рІѕрІГрѕЮ рІ░рѕўріЊ рѕЏрѕѕрЅх ріљрІЇрЇб\n30 ріќріЁрЇдрІ░рѕхрЅ│ рѕЏрѕѕрЅх ріљрІЇрЇб\n31 рѕ┤рѕЮрЇдрЅ░рѕЙрѕў рѕЏрѕѕрЅх ріљрІЇрЇб\n32 рІГрѕЦрѕљрЅЁрЇдрІ░рѕхрЅ│ ріаріЋрІхрѕЮ рІГрѕ│рЅЁ рѕЏрѕѕрЅх ріљрІЇрЇб\n33 рѕЎрѕ┤рЇдрІерІЇрѕЃ рѕЇрїЁ рѕЏрѕѕрЅх ріљрІЇ\n34 ріарѕ«ріЋрЇдрІеріЦрїЇрІџріарЅЦрѕћрѕГ рЅ░рѕФрѕФ рѕЏрѕѕрЅх ріљрІЇрЇб\n35 рїїрІ┤рІјріЋрЇдріЦрїЇрІџріарЅЦрѕћрѕГ ріЃрІФрѕЇ ріљрІЇ рѕЏрѕѕрЅх ріљрІЇрЇб\n36 ріЦрѕ┤рІГрЇдрІІрїІрІе рѕЏрѕѕрЅх ріљрІЇрЇб\n37 ріарѕџріЊрІ│рЅЦрЇдрѕўріЋрЇѕрѕхрЅЁрІ▒рѕх рѕЏрѕѕрЅх ріљрІЇрЇб\n38 рІ│рІірЅхрЇдрІерЅ░рІѕрІ░рІ░ рѕЇрЅа ріарѕЮрѕІріГ рѕЏрѕѕрЅх ріљрІЇрЇБ\n39 рІЋріЋрЅБрЅєрѕЮрЇдрїарЅбрЅЦ ріарІІрЅѓ ріарѕхрЅ░рІІрІГ рѕЏрѕѕрЅх ріљрІЇрЇб\n40 рѕёріцрѕюріЋрЇдрѕЮріърЅ┤ріЋ ріарїѕріўрѕЂ рѕЏрѕѕрЅх ріљрІЇрЇб\n41 ріарѕърїйрЇдріЦрїЇрІџріарЅЦрѕћрѕГ рїйріЉ ріљрІЇ рѕЏрѕѕрЅх ріљрІЇрЇБ\n42 рІ«ріЊрѕхрЇдрѕГрїЇрЅЦ рѕЏрѕѕрЅх ріљрІЇрЇб\n43 рѕљрїїрЇдрІеріЦрїЇрІџріарЅЦрѕћрѕГ рѕўрѕЇріЦріГрЅ░ріЏ рѕЏрѕѕрЅх ріљрІЇрЇб\n44 рѕФріёрѕЇрЇдрЅарїЇрІЋрЅх рѕЏрѕѕрЅх ріљрІЇрЇб\n45 рІЋрІЮрѕФрЇдрѕерІ│рЅ┤ рѕЏрѕѕрЅх ріљрІЇрЇб\n46 рѕћрѕГрѕюрѕІрЇдріеріГрЅЦрѕГ рІўрѕўрІх рІерЅ░рїѕріўрЅй рѕЏрѕѕрЅх ріљрІЇрЇб\n47 рѕўрѕГрЅєрѕгрІјрѕхрЇдрІеріарЅБрЅх рІѕрІ│рїЁ рѕЏрѕѕрЅх ріљрІЇрЇб\n48 ріцрї▓рЇІріЋрІ«рѕхрЇдрѕЮрѕхрїбрѕГ рїѕрѕІрїГ рѕЏрѕѕрЅх ріљрІЇрЇб\n49 рѕюрѕ«ріЋрЇдрІерЅ░рЅБрѕеріе рѕйрЅ▒ рѕЏрѕѕрЅх ріљрІЇрЇб\n50 рѕ▒рѕІрѕЏрїбрѕхрЇдрѕ░рѕІрѕЏрІірЅх рѕЏрѕѕрЅх ріљрІЇрЇб\n51 рѕХрѕЮрѕХріЋрЇдрЇђрѕљрІГ рѕЏрѕѕрЅх ріљрІЇрЇб\n52 рЅЦріЋрІФрѕЮрЇдрІерЅђріЮ ріЦрїё рѕЇрїЁ рѕЏрѕѕрЅх ріљрІЇрЇб\n53 рѕЏрѕГрЅ│рЇдріЦрѕўрЅцрЅх рѕЏрѕѕрЅх ріљрІЇрЇб\n54 рѕірІ▓рІФрЇдрЇѕрѕФрѕѓрЅ░ ріЦрїЇрІџріарЅЦрѕћрѕГ рѕЏрѕѕрЅх ріљрІЇрЇб\n55 ріцрЇЇрѕгрѕЮрЇдрЇЇрѕгрІФрѕЏ рЇЇрѕгрІЇ рѕЏрѕѕрЅх ріљрІЇрЇб \n56 ріцрЇЇрѕФрЅ│рЇдріГрЅЦрѕГрЅх рІерЅ░ріерЅарѕерЅй рѕЏрѕѕрЅх ріљрІЇрЇб\n57 рЅ│рІ┤рІјрѕхрЇдрЅ░рІѕрІ│рїЁ рІѕрІГрѕЮ рЇЇрЅЂрѕГ рѕЏрѕѕрЅх ріљрІЇрЇб(рЅЃрѕІрІі рЅхрѕГрїЊрѕюрІЇ)\n58 рібрІерѕЕрѕ│рѕїрѕЮрЇдрІерѕ░рѕІрѕЮ рѕђрїѕрѕГ рѕЏрѕѕрЅх ріљрІЇрЇб\n59 рѕёріќрѕхрЇдрѕ░рІЇ рѕЏрѕѕрЅх ріљрІЇрЇб\n60 рѕ░рѕјрѕюрЇдрѕ░рѕІрѕЮ рѕЏрѕѕрЅх ріљрІЇрЇб\nрЇб\nрѕЏрѕхрЅ│рІѕрѕ╗рЇдріерѕІрІГ ріерї╗рЇЇрі│рЅИрІЇ рІЇрѕхрїЦ ріаріЋрІ│ріЋрІх рѕхрѕърЅй ріе81рІ▒ рѕўрїйрѕљрЇЇ рЅЁрІ▒рѕх рІЇрѕхрїЦ рІерѕЏрІГрїѕріЎ ріерѕїрѕјрЅй рІерЅ│рѕфріГ ріЦріЊ рІерїѕрІхрѕЇ рѕўрї╗рѕЋрЇЇрЅх рІЇрѕхрїЦ рІерѕџрїѕріЎ рѕхрѕърЅй рѕўрѕєріЊрЅИрІЇріЋ рѕЏрѕ│рІѕрЅЁ ріЦрЇѕрѕЇрїІрѕѕрѕЂрЇб\nрІерЅ┤рѕїрїЇрѕФрѕЮ рЅ╗ріЊрѕїрЇдріаріљ рІўріГрѕГрѕхрЅХрѕх\n"
