                "­Ъї╣рїЇріЦрІЮ рЅІріЋрЅІ ріГрЇЇрѕЇ 7­Ъї╣\nрѕЦрѕГрІЊрЅ░ ріЋрЅБрЅЦ\nріаріљрЅБрЅарЅАріЋ рЅарЅ┤рѕїрїЇрѕФрѕЮ рЅарідрІхрІ« рѕхрѕѕрѕЮрѕѕрЅђрІЇ ріерІџрІФ рѕўрѕўрѕЇріерЅх рІГрЅ╗рѕІрѕЇрЇбрѕЋрїјрЅ╣ріЋ рїЇріЋ ріерІџрѕЁ рЅ░рѕўрѕЇріерЅ▒рЇб рІерїЇріЦрІЮ рЅІріЋрЅІ рІерѕФрѕ▒ рІерѕєріљ рѕЦрѕГрІЊрЅ░ ріЋрЅБрЅЦ ріарѕѕрІЇрЇбрЅ░ріљрѕхрЅХ рІерѕџріљрЅарЅарІЇріЋ рїЦрѕѕріЋ ріФріљрЅарЅЦріљрІЇ рІерЅхрѕГрїЅрѕЮ рѕѕрІЇрїЦ рІФрѕўрїБрѕЇрЇбрѕѕрѕЮрѕ│рѕї \"ріаріЦрѕўрѕФ\" рІерѕџрѕѕрІЇріЋ рЅЃрѕЇ ріаріЋрѕхрЅ░ріЋ рѕхріЊріљрЅарІЇріЊ рЅарІѕрІ│рЅѓ ріЋрЅБрЅЦ рѕхріЊріљрЅарІЇ рІерЅ░рѕѕрІФрІе рЅхрѕГрїЅрѕЮ ріарѕѕрІЇрЇб ріаріЋрѕхрЅ░ріЋ рѕхріЊріљрЅарІЇ ріЦріљрІџрІФ рѕ┤рЅХрЅй ріарІѕрЅЂ рѕЏрѕѕрЅх ріљрІЇрЇб рЅарІѕрІ│рЅѓ ріЋрЅБрЅЦ рѕхріЊріљрЅарІЇ рІ░рїЇрѕъ рІФ рѕ░рІЇ рІФрЅйріЋ рѕ┤рЅх ріарІѕрЅЃрЅх рЅ░рЅЦрѕј рІГрЅ░рѕерїјрѕЏрѕЇрЇбрЅ░ріљрѕйріЊ рѕ░рІФрЇЇ ріЋрЅБрЅБрЅх рЅєрїБ рЅЦрѕѕрІЇ рІГріљрЅарЅБрѕЅрЇб рІѕрІ│рЅѓріЊ рЅ░рїБрІГ ріЋрЅБрЅБрЅх рІ░рїЇрѕъ рѕ░ріеріЋ рЅЦрѕѕрІЇ рІГріљрЅарЅБрѕЅрЇб рЅарїарЅЁрѕІрѕІрІЇ рЅарїЇріЦрІЮ рЅІріЋрЅІ ріарѕФрЅх рІЊрІГріљрЅх рІеріЋрЅБрЅЦ рІЊрІГріљрЅХрЅй ріарѕЅрЇбріЦріљрІџрѕЁрѕЮрЇд\n             1 рЅ░ріљрѕй ріЋрЅБрЅЦ\n             2 рІѕрІ│рЅѓ ріЋрЅБрЅЦ\n             3 рѕ░рІФрЇЇ ріЋрЅБрЅЦ\n             4 рЅ░рїБрІГ ріЋрЅБрЅЦ \nріЊрЅИрІЇрЇбріаріЋрІх рЅЃрѕЇ ріеріарѕФрЅ▒ рЅарІерЅхріЏрІЇ ріЦріЋрІ░рѕџріљрЅарЅЦ рѕѕрѕЏрІѕрЅЁ рІерѕџрѕерІ▒ріЋ рѕЂрѕѕрЅх рѕўрѕарѕерЅ│рІі рѕўрѕѕріфрІФрІјрЅй ріарѕЅріЋрЇбріЦріљрІџрѕЁрѕЮрЇд\n        1 рІерЅЃрѕЇ ріГрЇЇрѕЅ\n        2 рІерЅЃрѕЅ рѕўрІхрѕерѕ╗ рЇірІ░рѕЇ\nріЊрЅИрІЇрЇбрІерЅЃрѕЇ ріГрЇЇрѕЅ рІФрѕЇріљрІЇ ріаріЋрІ▒ рїЇрѕЦ (Verb) рѕ▓рѕєріЋ рѕЂрѕѕрЅ░ ріЏрІЇ рІ░рїЇрѕъ ріерїЇрѕЦ рІЇрїГ рІФрѕЅ рЅЃрѕІрЅх ріЊрЅИрІЇрЇбрѕхрѕѕрІџрѕЁ ріарѕЂріЋ ріЦрІФріЋрІ│ріЋрІ▒ріЋ ріЦріЋрѕўрѕЇріерЅхрЇб\n               ",
