                "\nрЅ░ріљрѕй ріЋрЅБрЅЦ рІерѕџрѕєріЉ рЅЦрІЎ рїірІю рїЇрѕдрЅй рѕ▓рѕєріЉ рѕўрІхрѕерѕ╗ рЅЃрѕІрЅИрІЇ ріерѕ│рІхрѕх ріЦріЊ ріеріЃрѕЮрѕх рІЇрїГ рѕірѕєріЋ рІГрЅйрѕІрѕЇрЇб рЅаріЃрѕЮрѕх ріЦріЊ рЅарѕ│рІхрѕх рІерѕџрїерѕГрѕх рЅ░ріљрѕй ріЋрЅБрЅЦ рІерѕѕрѕЮрЇб рѕхрѕѕрІџрѕЁ ріаріЋрІх рЅЃрѕЇ рѕўрІхрѕерѕ╗рІЇ рѕ│рІхрѕх рІѕрІГрѕЮ ріЃрѕЮрѕх ріерѕєріљ рЅђрїЦрЅ│ рЅ░ріљрѕй ріЦріЋрІ│рѕЇрѕєріљ рѕўрѕерІ│рЅх ріарѕѕрЅЦріЋрЇб рѕѕрѕЮрѕ│рѕї \"рІЇрІ│рѕ┤\" рІерѕџрѕЇ рЅЃрѕЇ рЅЦріЊрІГ рѕўрїерѕерѕ╗ рЇірІ░рѕЅ \"рѕ┤\" ріЃрѕЮрѕх рѕхрѕѕрѕєріљ рЅарЅ░рїерѕЏрѕфрѕЮ \"рІЇрІ│рѕ┤\" рІерѕџрѕѕрІЇ рЅЃрѕЇ ріерїЇрѕЦ рІЇрїГ рѕхрѕѕрѕєріљ (рѕхрѕЮ рІѕрІГрѕЮ Noun) рѕхрѕѕрѕєріљ рЅ░ріљрѕй ріарѕѕрѕўрѕєріЉріЋ рІФрѕ│рІеріЊрѕЇрЇб \n        рЅарїЇріЦрІЮрЇд рЅђрЅ░рѕѕрЇБ рІѕрІ░рѕ░\n        рЅаріФрІЋрЅЦрЇдрЅђрЅ░рѕЅрЇБрЅђрІ░рѕ▒\n        рЅарѕБрѕЇрѕхрЇдрѕЉрѕф рІѕрЅЦрѕЇрІњ\n        рЅарѕФрЅЦрІЋрЇдрѕЉрѕФ\n        рЅарѕ│рЅЦрІЋрЇдрЅђрІхрѕХ\nрІГрѕІрѕЇ рѕЏрѕѕрЅх ріљрІЇрЇбрЅарЅ░рїерѕЏрѕф рЅарѕ│рІхрѕх рІерѕџрїерѕГрѕ▒ рѕхрѕърЅй рЅ░рѕ│рЅб \"Object\" рѕ▓рѕєріЉ рЅ░ріљрѕхрЅ░рІЇ рІГріљрЅарЅБрѕЅрЇб рѕѕрѕЮрѕ│рѕї \"рѕўріЋрїЇрѕЦрЅх\" рІерѕџрѕѕрІЇ рЅЃрѕЇ рѕўрїерѕерѕ╗ рЇірІ░рѕЅ рѕ│рІхрѕх рѕхрѕѕрѕєріљ рЅ░ріљрѕй ріарІГрІ░рѕѕрѕЮрЇб ріљрїѕрѕГ рїЇріЋ рЅ░рѕ│рЅб рѕ▓рѕєріЋ \"рѕўріЋрїЇрѕЦрЅ░\" рѕхрѕѕрѕџрѕЇ рЅ░ріљрѕй рІГрѕєріЊрѕЇ рѕЏрѕѕрЅх ріљрІЇрЇбрЅ░ріљрѕй ріЋрЅБрЅЦ рЅарІЇрѕГрІх ріЋрЅБрЅЦ рїірІю рЅЁрІхрѕў рѕўрІхрѕерѕ╗рІЇріЋ рІФрІЮ ріарІхрѕГрїј рѕўрІхрѕерѕ╗рІЇріЋ рЇірІ░рѕЇ рѕерїѕрїЦ ріарІхрѕГрїј рІГріљрЅарЅБрѕЇрЇб рЅЁрІхрѕў рѕўрІхрѕерѕ╗рІЇ рѕ│рІхрѕх ріерѕєріљ рїЇріЋ рЅЁрІхрѕў рЅЁрІхрѕў рѕўрІхрѕерѕ╗рІЇріЋ рІФрІЮ ріарІхрѕГрїј рІГріљрЅарЅБрѕЇрЇб\n              ",
