                "­Ъї╣рїЇріЦрІЮ рЅІріЋрЅІ ріГрЇЇрѕЇ 8­Ъї╣\nрІе \"рѕ░рЇБрѕарЇБріарЇБрІљрЇБрїИрЇБрЇђрЇБрѕђрЇБріђрЇЦрѕљ\" рѕЇрІЕріљрЅх\nрЇб\nрЅарїЇріЦрІЮ рЅІріЋрЅІ рЅаріЦрѕ│рЅ▒ \"рѕ░\" рІерЅ░рї╗рЇѕрІЇріЋ рЅаріЋрїЅрѕА \"рѕа\" ріерЅ░рї╗рЇѕ ріЦріЊ рЅарІЊрІГріЉ \"рІљ\" рѕўрї╗рЇЇ рІФрѕѕрЅарЅхріЋ рЅаріарѕЇрЇІрІЇ \"ріа\" рІѕрІўрЅ░ ріЦрІФрѕЇріЋ ріерї╗рЇЇріЋ рІерЅхрѕГрїЅрѕЮ рѕѕрІЇрїЦ рѕхрѕѕрѕџрІФрѕўрїБ рїаріЋрЅЁрЅє рѕЏрІѕрЅЁ рІФрѕхрЇѕрѕЇрЅЃрѕЇрЇб рѕѕрѕЮрѕ│рѕї \"рѕарѕерЅђ\" ріЦріЊ \"рѕ░рѕерЅђ\" рѕЂрѕЅрЅ▒ рЅарїБрѕЮ рІерЅ░рѕѕрІФрІЕ рЅЃрѕІрЅх ріЊрЅИрІЇрЇб \"рѕарѕерЅђ\" рѕЏрѕѕрЅх рІѕрїБ рѕЏрѕѕрЅх рѕ▓рѕєріЋ рѕЮрѕЦрѕФрЅЁ рІерѕџрѕѕрІЇ ріарЅЁрїБрїФ рїарЅІрѕџ рІерѕџрІѕрїБрЅарЅх ріљрІЇрЇб\"рѕ░рѕерЅђ\" рѕЏрѕѕрЅх рїЇріЋ рѕ░рѕерЅђ рѕЏрѕѕрЅх ріљрІЇрЇб рѕЦрѕѕрІџрѕЁ рЇірІ░рѕІрЅ▒ рѕІрІГ рѕўрїаріЋрЅђрЅЁ рІФрѕхрЇѕрѕЇрїІрѕЇрЇбрѕїрѕІ рѕЮрѕ│рѕї \"рѕарІљрѕѕ\" рІерѕџрѕѕрІЇ ріЦріЊ \"рѕ░ріарѕѕ\" рѕ▓рѕЇ рѕЂрѕѕрЅ▒ рІерЅ░рѕѕрІФрІЕ ріЊрЅИрІЇрЇб рѕарІљрѕѕ рѕЏрѕѕрЅх рѕЦрІЋрѕЇ рѕБрѕѕ рѕЏрѕѕрЅх ріљрІЇрЇбрѕарІЊрѕі рІерѕџрѕѕрІЇ рѕЦрІЋрѕЇ рІерѕџрѕхрѕЇ рѕЏрѕѕрЅх ріљрІЇрЇб \"рѕ░ріарѕѕ\" рІерѕџрѕѕрІЇ рїЇріЋ \"рѕѕрѕўріљ\" рѕЏрѕѕрЅх ріљрІЇрЇб \"рѕ░ріБрѕі\" рѕЏрѕѕрЅх \"рѕѕрѕЮріџ\" рѕЏрѕѕрЅх ріљрІЇрЇб рѕ░ріБрѕі рѕѕріљ рЅЁрІхрѕхрЅх рѕхріЋрѕЇ рЅЁрІхрѕхрЅх рѕєрІГ рѕѕрѕЮріџрѕЇріЋ рѕЏрѕѕрЅх ріљрІЇрЇб рѕхрѕѕрІџрѕЁ рЇірІ░рѕІрЅхріЋ рїѕріЊ рЅарІхрѕЮрїй рЅ░рѕўрѕ│рѕ│рІГ ріЊрЅИрІЇ рЅЦрѕѕріЋ ріЦрІФрІ░рЅарѕІрѕѕрЅЁріЋ рѕўрї╗рЇЇ ріарІГрїѕрЅаріЋрѕЮрЇб рІерЇірІ░рѕІрЅ▒ рѕЦрѕЮ ріЦріЋрІ░рѕџріерЅ░рѕѕрІЇ ріљрІЇрЇб\nрЇб\n1 ріа.....ріарѕЇрЇІрІЇ ріа\n2 рІљ.....рІЊрІГріЉ ріа\n3 рѕа.....ріЋрїЅрѕА рѕа\n4 рѕ░.....ріЦрѕ│рЅ▒ рѕ░\n5 рЇђ.....рЇђрѕљрІЕ рЇђ\n6 рїИ......рїИрѕјрЅ▒ рїИ\n7 рѕђ......рѕђрѕїрЅ│рІЇ рѕђ\n8 рѕљ.....рѕљрѕўрѕЕ рѕљ\n9 ріђ......рЅЦрІЎріЃріЉ ріђ\nрЇб\nрІГрЅБрѕІрѕЅ рѕхрІФрѕюрІФрЅИрІЇріЋ рІФрїѕріЎрЅх ріерІџрѕЂ ріерЅЃрѕЅ ріљрІЇрЇб рѕѕрѕЮрѕ│рѕї \"ріарѕЇрЇІ\" рЅЦрѕѕріЋ рѕхріЋрїйрЇЇ рІерѕЮріЋрїарЅђрѕўрІЇ рЅЃрѕЇ \"ріа\" рѕхрѕѕрѕєріљ рѕхрІФрѕюрІЇріЋ ріерІџрѕЁ ріарїЇріЮрЅирѕЇрЇб рѕхрѕѕрІџрѕЁ \"рІљрѕЇрЇІ\" рЅ░рЅЦрѕј ріарІГрї╗рЇЇрѕЮ рѕЏрѕѕрЅх ріљрІЇрЇбрѕїрѕІрІЇ рѕЇріЊрІЇрЅђрІЇ рІерѕџрїѕрЅБріЋ рѕѕрЅђрїБрІЕ рЅхрѕЮрѕЁрѕГрЅхрѕЮ рІерѕџрІФрїѕрѕѕрїЇрѕѕріЋ ріерѕђ ріЦрѕхріе рѕє рІФрѕЅ рЇірІ░рѕІрЅх рѕўрїарѕфрІФ ріарѕІрЅИрІЇрЇбрІГрійрІЇрѕЮ ріЦріЋрІ░рѕџріерЅ░рѕѕрІЇ ріљрІЇрЇб\nрЇб\n1 рѕђ......рїЇріЦрІЮ\n2 рѕЂ......ріФрІЋрЅЦ\n3 рѕѓ.......рѕБрѕЇрѕх\n4 рѕЃ........рѕФрЅЦрІЋ\n5 рѕё........ріЃрѕЮрѕх\n6 рѕЁ........рѕ│рІхрѕх\n7 рѕє........рѕ│рЅЦрІЋ\nрЇб\nріЊрЅИрІЇ рѕѕрѕЮрѕ│рѕї \"рѕђ\" ріЦріЊ \"рѕЃ\" рЅарІхрѕЮрїй рЅ░рѕўрѕ│рѕ│рІГ рѕхрѕѕрѕєріЉ рЅЦрѕѕріЋ рІ░рЅарѕІрѕЇрЅђріЋ рѕўрї╗рЇЇ рІерѕѕрЅЦріЋрѕЮрЇб рѕЮріГріЋрІФрЅ▒рѕЮ рІерЅхрѕГрїЅрѕЮ рѕѕрІЇрїЦ рѕхрѕѕрѕџрІФрѕўрїБ ріљрІЇрЇб рѕѕрѕЮрѕ│рѕї \"рѕўрѕГрѕЊ\" рЅЦрЅхрѕЇріЊ \"рѕўрѕГрѕљ\" рЅЦрЅхрѕЇ рѕўрѕГрѕЊ рѕЏрѕѕрЅх рЅЦрІЎ рѕ┤рЅХрЅй рѕўрѕЕ рѕЏрѕѕрЅх ріљрІЇрЇб рѕўрѕГрѕљ рѕЏрѕѕрЅх рїЇріЋ ріаріЋрІх рІѕріЋрІх рѕўрѕФ рѕЏрѕѕрЅх ріљрІЇрЇб рѕхрѕѕрІџрѕЁ рІГрѕЁріЋріЋ рїаріЋрЅЁрЅє рѕЏрІѕрЅЁ рІГрїѕрЅБрѕЇрЇбрѕїрѕІрІЇ рІ▓рЅЃрѕІ рЇірІ░рѕІрЅх рІерѕџрЅБрѕЅ рЅірЇБрі▓рЇБріірЇБрїњ ріФрІЋрЅЦріЊ рѕ│рЅЦрІЋ рІерѕІрЅИрІЇрѕЮрЇб рѕхрѕѕрІџрѕЁ рЅаріЦрѕГрЅБрЅ│ рїірІю рѕ│рЅЦрІЋ ріЦріЊ ріФрІЋрЅЦ рЅБрѕхрЇѕрѕѕрїѕрЅарЅх рїірІю рЅа\"рЅђрЇБріерЇБріђрЇБрїѕ\" ріФрІЋрЅЦ ріЦріЊ рѕ│рІхрѕх рІГрѕерЅБрѕЅрЇб\nрЇб\nріЦрІФріЋрІ│ріЋрІ▒ рЅЃрѕЇ рЅарІерЅхріЏрІЇ рЇірІ░рѕЇ ріЦріЋрІ░рѕџрї╗рЇЇ рѕѕрѕЏрІѕрЅЁ рїЦріЋрЅ│рІі рѕўрї╗рѕЋрЇЇрЅхріЋ ріарІўрІЇрЅхрѕеріЋ рЅарѕЏріЋрЅарЅЦ ріЦріЊрІЇрЅђрІІрѕѕріЋрЇб\nрЇб\nрїЦрІФрЅё\nрІерѕџріерЅ░рѕѕрЅ▒ріЋ рЅарІерЅхріЏрІЇ рЇірІ░рѕЇ ріЦріЋрІ░рѕџрї╗рЇЅ рѕѕрІЕ\n1) ріарѕхрЅ░рѕЏрѕе рѕ▓рѕЇ \n       рѕђ, рѕўрѕђрѕе\n       рѕѕ, рѕўрѕљрѕе\n       рѕљ, рѕўріђрѕе\n2) рѕЏрѕе рІГрЅЁрѕГ ріарѕѕ рѕ▓рѕЇ рІерЅхріЏрІЇ ріљрІЇ?\n      рѕђ, рѕўрѕђрѕе\n      рѕѕ, рѕўрѕљрѕе\n      рѕљ, рѕўріђрѕе\n3) рІѕрІ░ рѕ░рѕЏрІГ рІѕрїБ рѕѕрѕЏрѕѕрЅх рІѕрїБ рѕ▓рѕЇ\n       рѕђ, рІљрѕГрїѕ\n       рѕѕ, ріарѕГрїѕ\nрѕерІхріцрЅ░ ріЦрїЇрІџріарЅЦрѕћрѕГ ріарІГрѕѕрІеріЋ\nрЇб\n рІерЅ┤рѕїрїЇрѕФрѕЮ рЅ╗ріЊрѕї ріаріљ рІўріГрѕГрѕхрЅХрѕх ",
