                " \nрЅарїЇріЦрІЮ рЅІріЋрЅІ ріаріЋрІх рЅЃрѕЇ ріЦріЋрІ░рЅБрѕѕрЅцрЅхріљрЅх рІѕрІГрѕЮ \"Subject\" рѕ▓рІФрїѕрѕѕрїЇрѕЇріЊ ріЦріЋрІ░ рЅ░рѕ│рЅбріљрЅх \"Object\" рѕ▓рІФрїѕрѕѕрїЇрѕЇ рІерЅ░рѕѕрІФрІе рІерЇірІ░рѕЇ рѕўрІІрЅЁрѕГ ріарѕѕрІЇрЇб рѕѕрѕЮрѕ│рѕї рЅаріарѕЏрѕГріЏ ріцрІХрѕЮ ріЦріЋрїђрѕФ рЅарѕІрЅйрЇб рѕхріЋрѕЇ ріЦріЊ \"ріЦріЋрїђрѕФ рІГрЅарѕІрѕЇ\" рЅЦріЋрѕЇ ріЦріЋрїђрѕФ рІерѕџрѕѕрІЇ рЅЃрѕЇ рЅарѕўрїђрѕўрѕфрІФрІЇ рЅ░рѕ│рЅб рѕ▓рѕєріЋріЊ рЅђрїЦрѕј рЅБрѕѕрЅцрЅх рѕ▓рѕєріЋ рѕЮріЋрѕЮ рІЊрІГріљрЅх рѕѕрІЇрїЦ ріарѕІрѕўрїБрѕЮрЇб рЅарїЇріЦрІЮ рЅІріЋрЅІ рїЇріЋ рѕѕрІЇрїЦ ріарѕѕрІЇрЇб ріцрІХрѕЮ рЅарѕЇрІљрЅх ріЁрЅЦрѕхрЅ░ рІГрѕІрѕЇрЇб ріЦріЋрїђрѕФ рІГрЅарѕІрѕЇ рѕѕрѕЏрѕѕрЅх рїЇріЋ ріЁрЅЦрѕхрЅх рІГрЅхрЅарѕІрІЋ рІГрѕІрѕЇрЇб ріарѕхрЅ░рІЇрѕЇ рЅ░рѕ│рЅб рѕ▓рѕєріЋ \"ріЁрЅЦрѕхрЅ░\" рЅЦрѕј рЅБрѕѕрЅцрЅх рѕ▓рѕєріЋ рїЇріЋ \"ріЁрЅЦрѕхрЅх\" рІГрѕІрѕЇрЇбрѕўрІхрѕерѕ╗ рЅђрѕѕрѕЎ ріЦріЋрІ░рЅ░рѕѕрІФрІе ріарѕхрЅ░рІЇрѕЇрЇб рІерѕўрїђрѕўрѕфрІФрІЇ рїЇріЦрІЮ \"рЅ░\" рѕЂрѕѕрЅ░ріЏрІЇ рѕ│рІхрѕх \"рЅх\" рѕєріЌрѕЇрЇбрѕхрѕѕрІџрѕЁ рЅЃрѕІрЅх рЅ░рѕ│рЅб рѕ▓рѕєріЉ рѕЋрїЇ ріарѕІрЅИрІЇрЇб \nрЇб\n       <<рѕ│рІхрѕх рЅЃрѕІрЅх рѕ▓рѕ│рЅА рїЇріЦрІЮ\n       <<ріФрІЋрЅЦ рЅЃрѕІрЅх рѕ▓рѕ│рЅА рѕ│рЅЦрІЋ\n       <<рѕБрѕЇрѕх рЅЃрѕІрЅх рѕ▓рѕ│рЅА ріЃрѕЮрѕх\n       <<рѕФрЅЦрІЋ рЅЃрѕІрЅх рѕ▓рѕ│рЅА ріарІГрѕѕрІѕрїАрѕЮ\n       <<ріЃрѕЮрѕх рЅЃрѕІрЅх рѕ▓рѕ│рЅА ріарІГрѕѕрІѕрїАрѕЮ\n       <<рѕ│рЅЦрІЋ рЅЃрѕІрЅх рѕ▓рѕ│рЅА ріарІГрѕѕрІѕрїАрѕЮ\n       <<рІерѕђрїѕрѕГ рѕхрѕърЅйріЊ рЅ░ріЊрЅБрЅб рЅЃрѕІрЅх рѕ▓рѕ│рЅА ріарІГрѕѕрІѕрїАрѕЮ\n       <<рІерѕ░рІЇ рѕхрѕЮ рѕ▓рѕ│рЅЦ рѕўрІхрѕерѕ╗рІЇ рѕІрІГ \"рѕЃ\" рЇірІ░рѕЇріЋ рІГрїерѕЮрѕФрѕЅрЇб\nрЇб\nрѕѕрѕЮрѕ│рѕї \"рЅцрЅ▒\" рІГрѕЇ рІеріљрЅарѕерІЇ рѕ▓рѕ│рЅЦ \"рЅцрЅХ\" рІГрѕІрѕЇрЇбрЅ▒ ріФрІЋрЅЦ ріљрЅарѕе рѕ▓рѕ│рЅЦ рїЇріЋ рЅХ рѕ│рЅЦ рІЋ рѕєріљ рѕЏрѕѕрЅх ріљрІЇрЇб рїИрѕЊрЇі рІГрѕЇ рІеріљрЅарѕерІЇ рѕ▓рѕ│рЅЦ \"рїИрѕЊрЇї\" рІГрѕєріЊрѕЇрЇбрЇі рѕБрѕЇрѕх рІѕрІ░ ріЃрѕЮрѕх рЇї рѕўрѕѕрІѕрїДріЋ ріарѕхрЅ░рІЇрѕЇрЇб \"рѕђрїѕрѕГ\" рІГрѕЇ рІеріљрЅарѕерІЇ рѕ▓рѕ│рЅЦ \"рѕђрїѕрѕе\" рІГрѕІрѕЇрЇб рѕГ рѕ│рІхрѕх рІѕрІ░ рїЇріЦрІЮ рѕе рѕўрѕѕрІѕрїДріЋ ріарѕхрЅ░рІЇрѕЇрЇбрѕФрЅЦрІЋрЇБріЃрѕЮрѕх ріЦріЊ рѕ│рЅЦрІЋ рЅЃрѕІрЅх рѕ▓рѕ│рЅА ріарІГрѕѕрІѕрїАрѕЮ рѕЏрѕѕрЅх рѕѕрѕЮрѕ│рѕї \"рІЇрІ│рѕ┤рЇБріЦріЋрІџрѕФрЇБрѕўрѕ░ріЋрЅє\" рІерѕџрѕЅрЅх рЅЃрѕІрЅх рѕ▓рѕ│рЅАрѕЮ рЅБрѕЅрЅарЅх \"рІЇрІ│рѕ┤рЇБріЦріЋрІџрѕФрЇБрѕўрѕ░ріЋрЅє\" рІГрѕІрѕЅ рѕЮріЋрѕЮ рІЊрІГріљрЅх рІерЇірІ░рѕЇ рѕѕрІЇрїЦ ріарІФрѕўрїАрѕЮ рѕЏрѕѕрЅх ріљрІЇрЇбрІерѕђрїѕрѕГ рѕхрѕърЅйріЊ рЅ░ріЊрЅБрЅб рЅЃрѕІрЅхріЋ рЅ░рѕ│рЅб рѕ▓рѕєріЉ рѕЮріЋрѕЮ рІЊрІГріљрЅх рѕѕрІЇрїЦ ріарІФрѕўрїАрѕЮрЇб \"рЅцрЅ░рѕўріЋрїЇрѕЦрЅх\" рѕ▓рѕ│рЅЦ рІФрІЇ рЅБрѕѕрЅарЅх \"рЅцрЅ░рѕўріЋрїЇрѕЦрЅх\" рІГрѕІрѕЇ рѕЏрѕѕрЅх ріљрІЇрЇбрїјрїЃрѕЮрЇБрїјріЋрІ░рѕГрЇБрЅхрїЇрѕФрІГ рІерѕџрѕЅ рЅЃрѕІрЅхрѕЮ рѕ▓рѕ│рЅА ріЦрІџрІФрІЇ рЅБрѕЅрЅарЅх рїјрїЃрѕЮрЇБрїјріЋрІ░рѕГрЇБрЅхрїЇрѕФрІГ рІГрѕІрѕЅ рѕЏрѕѕрЅх ріљрІЇрЇбрІерѕ░рІЇ рѕхрѕЮ рѕ▓рѕ│рЅЦ \"рѕђ\" рІерѕџрѕЇ рЇірІ░рѕЇріЋ рІГрїерѕЮрѕФрѕЅрЇбрѕѕрѕ┤рЅх рѕ▓рѕєріЋ \"рѕЃ\"ріЋ ріЦріЋрїерѕЮрѕФрѕѕріЋрЇб рѕѕрѕЮрѕ│рѕї ріЦріЏ рѕЏрѕГрІФрѕЮріЋ ріЦріЋрІѕрІ│рѕѕріЋ рІерѕџрѕѕрІЇ ріЋрѕЋріљ ріЊрЇѕрЅЁрѕГ рѕЏрѕГрІФрѕЮрѕЃ рІГрѕІрѕЇрЇб рѕЏрѕГрІФрѕЮ рІеріГрѕГрѕхрЅХрѕх ріЦріЊрЅх ріЊрЅх рѕ▓рѕЇ рїЇріЋ рЅБрѕѕрЅцрЅх рѕхрѕѕрѕЮрЅхрѕєріЋ рЅБрѕѕрЅарЅх рѕЏрѕГрІФрѕЮ рІГріЦрЅ▓ ріЦрѕЎ рѕѕріГрѕГрѕхрЅХрѕх рІГрѕІрѕЇ рѕЏрѕѕрЅх ріљрІЇрЇб\nрЇб\nрїЦрІФрЅё\nрІерѕџріерЅ░рѕЅрЅхріЋ рЅЃрѕІрЅх рЅ░ріЊрЅБрЅб ріарІхрѕГрїЅ\n         1, рІЇрІ│рѕ┤ ріЦріЊ рѕЏрѕГрІФрѕЮ\n         2, рѕўрѕ░ріЋрЅє ріЦріЊ рІ│рІірЅх\n         3, рІЮрѕЏрѕг ріЦріЊ рѕўрѕІріЦріГрЅх\n         4, рѕўрїІрЅб ріЦріЊ ріаріЦрѕІрЇЇ\n         5, рѕірЅЁ ріЦріЊ рѕЮрѕЂрѕФріЋ\nрІерѕџріерЅ░рѕЅрЅхріЋ рЅЃрѕІрЅх рЅ░рѕ│рЅб ріарІхрѕГрїЅ\n                  6 рѕ░рѕЏрІГ\n                  7 рѕўріЋрїЇрѕЦрЅ░рѕ░рѕЏрІФрЅх\n                  8 рЇѕрїБрѕф\n                  9 рѕђрїѕрѕЕ\n                  10 рїИрІљрІ│\nрѕерІхріцрЅ░ ріЦрїЇрІџріарЅЦрѕћрѕГ ріарІГрѕѕрІеріЋрЇб\n рІерЅ┤рѕїрїЇрѕФрѕЮ рЅ╗ріЊрѕї ріаріљ рІўріГрѕГрѕхрЅХрѕх ",
