                    "text": "­Ъї╣рїЇріЦрІЮ рЅІріЋрЅІ ріГрЇЇрѕЇ 9­Ъї╣\n       рЅ░ріЊрЅБрЅб рЅЃрѕІрЅх ріЦріЊ рЅ░рѕ│рЅб\nрѕЂрѕѕрЅх рЅЃрѕІрЅх рЅаріаріЋрІхріљрЅх рѕ▓рїБрѕўрѕЕ рЅ░ріЊрЅБрЅб рЅЃрѕІрЅх рІГрЅБрѕІрѕЅрЇбрѕѕрѕЮрѕ│рѕї \"рЅцрЅ░ рѕўріЋрїЇрѕЦрЅх\" рѕхріЋрѕЇ рЅцрЅх ріЦріЊ рѕўріЋрїЇрѕЦрЅх ріерѕџрѕЅ рЅЃрѕІрЅх рІерЅ░рІІрЅђрѕе ріљрІЇрЇбрІГрѕЁ рІ░рїЇрѕъ рІерѕФрѕ▒ рѕЋрїЇ рѕхрѕІрѕѕрІЇ ріЦрѕГрѕ▒ріЋ рІЏрѕг ріЦріЋрѕўрѕѕріерЅ│рѕѕріЋрЇб рѕўріЋрїЇрѕЦрЅх рІерЅцрЅх рІўрѕГрЇЇ рІГрЅБрѕІрѕЇрЇб\n         >>рѕ│рІхрѕх рЅЃрѕІрЅх рІѕрІ░ рїЇріЦрІЮ \n         >>рѕБрѕЇрѕх рЅЃрѕІрЅх рІѕрІ░ ріЃрѕЮрѕх\n         >>рѕФрЅЦрІЋ рЅЃрѕІрЅх ріарІГрѕѕрІѕрїАрѕЮ\n         >> ріЃрѕЮрѕх рЅЃрѕІрЅх ріарІГрѕѕрІѕрїАрѕЮ\n         >>рѕ│рЅЦрІЋ рЅЃрѕІрЅх ріарІГрѕѕрІѕрїАрѕЮ\nрІГрѕЁрѕЮ рѕЏрѕѕрЅх рѕѕрѕЮрѕ│рѕї \"рЅцрЅх\" рІерѕџрѕѕрІЇ рЅЃрѕЇ \"рѕўріЋрїЇрѕЦрЅх\" ріерѕџрѕѕрІЇ рЅЃрѕЇ рїІрѕГ рѕ▓ріЊрЅарЅЦ  рІерѕўрїерѕерѕ╗ рЇірІ░рѕЅ \"рЅх\" рІѕрІ░ \"рЅ░\" рЅ░рѕѕрІЇрїд \"рЅцрЅ░рѕўріЋрїЇрѕЦрЅх\" рІГрЅБрѕІрѕЇрЇб рѕБрѕЇрѕх рЅЃрѕІрЅх рІѕрІ░ріЃрѕЮрѕх рІГрѕѕрІѕрїБрѕЅ рІФрѕЇріљрІЇ рІ░рїЇрѕъ рѕѕрѕЮрѕ│рѕї \"рѕўрїІрЅб\" рІерѕџрѕѕрІЇ рЅЃрѕЇ \"рѕљрІ▓рѕх\" ріерѕџрѕѕрІЇ рЅЃрѕЇ рїІрѕГ рѕ▓ріЊрЅарЅЦ рѕБрѕЇрѕи \"рЅб\" рІѕрІ░ ріЃрѕЮрѕх \"рЅц\" рЅхрЅђрІерѕГріЊ \"рѕўрїІрЅц рѕљрІ▓рѕх\" рІГрѕІрѕЇ рѕЏрѕѕрЅх ріљрІЇрЇб рЅ░ріЊрЅБрЅб рЅЃрѕІрЅх рЅаріаріЋрІх рЅхріЋрЇІрѕй ріЦріЋрїѓ рЅ░ріљрїБрїЦрѕѕрІЇ ріарІГріљрЅарЅАрѕЮрЇбрѕФрЅЦрІЋ рЅЃрѕІрЅх ріарІГрѕѕрІѕрїАрѕЮ рІФрѕЇріљрІЇ рІ░рїЇрѕъ рѕѕрѕЮрѕ│рѕї \"рѕўріЊ\" рІерѕџрѕѕрІЇ рЅЃрѕЇ \"ріЦрѕхрѕФріцрѕЇ\" ріерѕџрѕѕрІЇ рЅЃрѕЇ рїІрѕГ рѕ▓ріЊрЅарЅЦ \"ріЊ\" рЅБрѕѕрЅарЅх рѕєріќ \"рѕўріЊ ріЦрѕхрѕФріцрѕЇ\" рІГрѕІрѕЇ рѕЏрѕѕрЅ│рЅйріЋ ріљрІЇрЇб ріЃрѕЮрѕх ріарІГрѕѕрІѕрїЦрѕЮ рІФрѕЇріљрІЇрѕЮ рѕѕрѕЮрѕ│рѕї \"рЅЁрІ│рѕ┤\" рІерѕџрѕѕрІЇ рЅЃрѕЇ ріЦріЊ \"рѕўрѕІріЦріГрЅх\" рІерѕџрѕѕрІЇ рЅЃрѕЇ рѕ▓ріЊрЅарЅА \"рѕ┤\" рЅБрѕѕрЅарЅх ріЃрѕЮрѕх рѕєріќ \"рЅЁрІ│рѕ┤ рѕўрѕІріЦріГрЅх\" рІГрѕІрѕЇ рѕЏрѕѕрЅ│рЅйріЋ ріљрІЇрЇб рѕ│рЅЦрІЋ рЅЃрѕІрЅх ріарІГрѕѕрІѕрїАрѕЮ рІФрѕЇріљрІЇрѕЮ рѕѕрѕЮрѕ│рѕї \"ріаріЦрѕЮрѕ«\" ріЦріЊ \"рѕірЅЃрІЇріЋрЅх\"ріЋ рЅЦріЊріЊрЅЦрЅБрЅИрІЇ рЅБрѕѕрЅарЅх \"ріаріЦрѕЮрѕ« рѕірЅЃрІЇріЋрЅх\" рІГрѕІрѕЇ рѕЏрѕѕрЅ│рЅйріЋ ріљрІЇрЇб\nрЅЃрѕІрЅх рѕ▓ріЊрЅарЅА рЅЦрІЎ рїірІю \"рІе\" рІерѕџрѕЇ рЅхрѕГрїЅрѕЮріЋ рІГрІГрІЏрѕЅрЇбрѕѕрѕЮрѕ│рѕї рѕЋрІЮрЅЦ ріЦріЊ рібрЅхрІ«рїхрІФ рѕ▓ріЊрЅарЅА рѕЋрІЮрЅа рібрЅхрІ«рїхрІФ рІГрѕІрѕЇрЇб рЅхрѕГрїЅрѕЎ рІерібрЅхрІ«рїхрІФ рѕЋрІЮрЅЦ рѕЏрѕѕрЅх ріљрІЇрЇб рЅаріЦріЋрїЇрѕірІўріЏ \"Of\" рІерѕџрѕЇ рЅхрѕГрїЅрѕЮ рѕЏрѕѕрЅх ріљрІЇрЇб People of Ethiopia рІГрѕІрѕЇрЇб\n            "
